import { Route, Routes } from "react-router-dom";
import MainHeader from "./Components/MainHeader";

import Product from "./Pages/Product";
import Welcome from "./Pages/Welcome";

function App() {
  return (
    <div>
      <MainHeader />
      <main>
        <Routes>
          <Route path="/welcome">
            <Welcome />
          </Route>
        </Routes>
        <Route path="/product">
          <Product />
        </Route>
      </main>
    </div>
  );
}

export default App;
